import { StatusBar } from 'expo-status-bar';
import React from 'react';
import { StyleSheet, Text, FlatList } from 'react-native';


const list = () => {
  return <Text styles={ styles.textStyle }>Hello World</Text>
}

const styles = StyleSheet.create({
  textStyle : {
    fontSize : 40,
    color    : 'red',
  }
})

export default list;
